  false,\n\t\"url\": null,\n\t\"notes\": \"This Comprehensive Conservation Plan (CCP)
  was written to guide management on McNary NWR for the next 15 years. This plan outlines
  the Refuge vision and purpose and describes how McNary NWR will contribute to the
  overall mission of the Refuge System. The plan provides an introduction to the Refuge,
  an overview of the CCP process, and information about the management direction.
  Key planning issues include: wildlife management, habitat management, shorebirds,
  salmonids, islands, public use, and cultural resources.\",\n\t\"license_title\":
